《'''Unknown Actor'''》是游戏《[[UNDER NIGHT IN-BIRTH]]》的Late[st]家用机版的[[片头曲]]。

== 简介 ==

UNI的系列OP之一，自Late[st]家用机版开始使用。

曲名Unknown Actor来源于UNI主人公[[城户灰都]]的绰号{{ruby|未明的共演者|Unknown Actor}}。

在联动作品《[[苍翼默示录|苍翼默示录：交叉组队战]]》中，为UNI势力的AH背景音乐。

== 歌曲 ==

* 演唱：伊舎堂 さくら
* 作曲：来兔
* 吉他：Godspeed (青木征洋)
* 作词：师走 幸希

